import{_ as t,c as o,o as n,ah as s}from"./chunks/framework.PvdZnrZd.js";const d=JSON.parse('{"title":"UPS SHIPPING","description":"UPS SHIPPING","frontmatter":{"title":"UPS SHIPPING","description":"UPS SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/ups-shipping.md","filePath":"zenith/featured-app/shipping/ups-shipping.md"}'),r={name:"zenith/featured-app/shipping/ups-shipping.md"};function a(p,e,l,i,h,g){return n(),o("div",null,[...e[0]||(e[0]=[s(`<p><a href="/zenith/introduction/"><strong>Multi-vendor Marketplace</strong></a> app has come up with the <strong>UPS</strong> feature app to manage product shipping, track the packages &amp; print shipping labels through the <strong>United Parcel Service (UPS)</strong>.</p><p>You can now visit the feature app section and enable the &quot;UPS&quot; feature app to let the sellers ship their products through UPS.</p><p>For this, you need to have a UPS account as you need your account details to configure UPS shipping in the app. In addition to it, you can allow sellers to generate shipping labels of fulfilled orders through UPS.</p><p>This feature of the Multivendor app will charge you an additional amount of $10 USD per month over and above your current Multivendor plan.</p><blockquote><p>To make UPS shipping feature work, you need to choose the Shopify store plan which supports the <strong>“Real-Time Carrier-Calculated Shipping”.</strong></p></blockquote><p><strong>Important Note</strong>:- “UPS Feature is available only in the Multivendor <strong>PRO ($60/month)</strong> Plan <strong>+</strong> You need to enable the “<a href="/zenith/featured-app/overview.html">Shipping” Feature App</a> which is <strong>FREE</strong> of cost.”</p><p>THIS SHIPPING FEATURE APP IS USED FOR <strong>BOTH RATE CALCULATION</strong> AND <strong>FULFILLMENT.</strong></p><p><strong>Note - New account users do not require UPS Access Keys. Once you configure the UPS Client_id and Client_secret Name, the system will automatically generate the Access token.</strong></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/02/screenshot_1708680488354.png" alt="screenshot_1708680488354"></p><h3 id="how-to-get-ups-credentials" tabindex="-1">How to get UPS Credentials <a class="header-anchor" href="#how-to-get-ups-credentials" aria-label="Permalink to &quot;How to get UPS Credentials&quot;">​</a></h3><p><strong>Log in</strong> <a href="http://developer.ups.com" target="_blank" rel="noreferrer"><strong>developer.ups.com</strong></a></p><p>On your UPS website, you need to go to the <strong>My App section</strong> in which you will select the <strong>Add apps</strong></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/02/screenshot_1708681015133-1200x458.png" alt="screenshot_1708681015133"></p><p>Select the options as highlighted in the image and click on <strong>Create Account.</strong></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/02/screenshot_1708681198629-1200x510.png" alt="screenshot_1708681198629"></p><p>Now, you will get the UPS Client ID and Client Secret key here which you have to use in the Multivendor Marketplace Application</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/02/screenshot_1708681380033-1200x486.png" alt="screenshot_1708681380033"></p><p>In the <strong>add products</strong> section, you need to select all the permissions by clicking on the <strong>(+)</strong> sign</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/02/screenshot_1708681433027.png" alt="screenshot_1708681433027"></p><h3 id="how-to-enable" tabindex="-1">How to Enable? <a class="header-anchor" href="#how-to-enable" aria-label="Permalink to &quot;How to Enable?&quot;">​</a></h3><p>You need to follow the below-given steps to activate the UPS feature app:-</p><ul><li>Go to the Multi-vendor Admin panel.</li><li>Visit the <strong>Feature App</strong> section.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/featuredapps.webp" alt="feature app"></p><ul><li>Search for the <strong>UPS</strong> feature app.</li><li>Click the &quot;<strong>Enable</strong>&quot; button.</li><li><strong>Proceed</strong> and <strong>Approve</strong> the charge for the same.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/ups.webp" alt="UPS feature app"></p><h3 id="admin-panel" tabindex="-1">Admin Panel <a class="header-anchor" href="#admin-panel" aria-label="Permalink to &quot;Admin Panel&quot;">​</a></h3><p><strong>Note: Kindly choose only those shipping services which you need. Don’t keep all the services selected otherwise it creates delay to retrieve shipping rates at the storefront.</strong></p><p>As soon as you enable the UPS featured app, a new sub-menu gets added to the Configuration menu of the app i.e. <strong>UPS</strong> <strong>Configuration</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/dashconfiguration.webp" alt="UPS Configuration"></p><p>Now, Go to the <strong>UPS Configuration</strong> section and enter all the details from your UPS account such as UPS access key, choose the shipping service (domestic or international), UPS shipper number, username, password, etc.</p><p><strong>Note - New account users do not require UPS Access Keys. Once you configure the UPS Client_id and Client_secret Name, the system will automatically generate the Access token.</strong></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/upsconfiguration.webp" alt="UPS shipping"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/configurationtwoups.webp" alt="screenshot_1708689979222"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/upsconfigthree.webp" alt="screenshot_1708689971851"></p><blockquote><p><strong>You will get all these details from your UPS account. Log in</strong> <a href="https://www.ups.com/lasso/login?loc=en_US" target="_blank" rel="noreferrer"><strong>UPS.com</strong></a></p></blockquote><p><strong>By default, we show the negotiated shipping rates. However, in case the negotiated shipping rates are not present, we show the general shipping rate</strong></p><p><strong>Note - For negotiable shipping rates, you can contact the UPS support.</strong></p><h3 id="default-pick-up-address" tabindex="-1">DEFAULT PICK-UP ADDRESS <a class="header-anchor" href="#default-pick-up-address" aria-label="Permalink to &quot;DEFAULT PICK-UP ADDRESS&quot;">​</a></h3><p>If there is an overseas order in UPS shipping the in case if you want both addresses i.e. &quot;seller&#39;s address and default pick up address saved in UPS dashboard&quot; should be sent to the customer.</p><p>Then you can enable &quot;DEFAULT PICK UP ADDRESS &quot; from UPS configuration.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/defaultpickupaddress.webp" alt="screenshot_1690983352537"></p><h3 id="make-shipping-address-phone-number-mandatory" tabindex="-1">Make <strong>Shipping</strong> <strong>Address Phone Number</strong> Mandatory <a class="header-anchor" href="#make-shipping-address-phone-number-mandatory" aria-label="Permalink to &quot;Make **Shipping** **Address Phone Number** Mandatory&quot;">​</a></h3><p>To use this feature add-on, the admin needs to make the <strong>Shipping</strong> <strong>address phone number mandatory</strong> at the time of <strong>checkout</strong>.</p><p>So, to do this, go to <strong>Shopify Backend</strong> &gt; <strong>Settings</strong> &gt; <strong>Checkout</strong> &gt; Under <strong>Form Options</strong>, make <strong>Shipping</strong> <strong>address phone number</strong> as <strong>Required</strong>.</p><p>Refer:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Demo-Store-Settings-Shopify-1200x597.png" alt="Shipping address phone number"></p><h3 id="seller-panel" tabindex="-1">Seller Panel <a class="header-anchor" href="#seller-panel" aria-label="Permalink to &quot;Seller Panel&quot;">​</a></h3><p>Once the admin configures the UPS details from his end, the same will reflect at the seller end. And now the seller needs to visit the &quot;<strong>Shipping Configuration</strong>&quot; menu &amp; enable the <strong>UPS</strong> feature.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/sellersideconfig.webp" alt="shipping"></p><p>There, the seller will get the UPS shipping method. Clicking the &quot;Enable&quot; button, the seller can activate the UPS for all his/her products.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/upsconfigseller.webp" alt="Shipping Configuration"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/upssellerenabled.webp" alt="UPS enabled"></p><p>Once enabled, the seller can set it as &quot;Default&quot; shipping method.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Shipping-Configuration-Seller-%E2%80%A2-Multivendor-MarketPlace-1-1.png" alt="Set as default"></p><p>Now, the sellers need to configure the Shipping Packet details from the &quot;<strong>Global Configuration</strong>&quot; section of the seller panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/configureupsseller.webp" alt="shipping package"></p><blockquote><p><strong>NOTE</strong>:- Admin can also set the shipping method as UPS by default for any seller&#39;s product from Seller Listing menu of the app.</p></blockquote><p>ADMIN PANEL:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Edit-Seller-Admin-1-1.png" alt="UPS shipping"></p><p>Once the seller enables the &quot;UPS&quot;, he/she can now choose UPS as a shipping method while adding a product.</p><p><strong>ADD PRODUCT FORM:-</strong></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Screenshot12.png" alt="Select shipping"></p><p>Now, the seller can ship products via UPS.</p><h3 id="shipping-label-generation" tabindex="-1">Shipping Label Generation <a class="header-anchor" href="#shipping-label-generation" aria-label="Permalink to &quot;Shipping Label Generation&quot;">​</a></h3><p>Moreover, once the order is fulfilled by the seller, he/she can now generate the shipping label from the order detail section of the app.</p><p>Seller first needs to select the method of order fulfillment as UPS and fulfill the order.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/orderfullpage.webp" alt="order fulfillment"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Screenshot13.png" alt="UPS shipping"></p><p>Once the order gets fulfilled, sellers can generate shipping label of the fulfilled order.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/generateshiipinglabel.webp" alt="Print Shipping Label"></p><p>A shipping label will be printed in the form of <strong>gif</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Screenshot-14-.png" alt="Shipping Label"></p><p>This is all about the Shipping Label Generation through UPS Fulfilment.</p><h3 id="select-the-usage-ups-configuration" tabindex="-1">Select the Usage-UPS Configuration <a class="header-anchor" href="#select-the-usage-ups-configuration" aria-label="Permalink to &quot;Select the Usage-UPS Configuration&quot;">​</a></h3><p>While configuring the UPS details, you can now choose to <strong>Send To Merchant</strong> if you want to fulfill the order and generate shipping labels on your warehouse address.</p><p>OR choose Both <strong>(Shipping+Fulfillment)</strong>, if you want the sellers to manage the order fulfillment &amp; generate shipping labels for customer&#39;s orders.</p><p>Go to Configuration&gt;&gt;UPS Configuration&gt;&gt;Select Usage As.</p><p>Select either <strong>Send To Merchant</strong> OR <strong>Both</strong> (Shipping+Fulfillment) while configuring the UPS details.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/Screenshot9-1-1200x614.png" alt="Screenshot9-1"></p><p>Let&#39;s understand both cases.</p><p>**Case 1: Both (Fulfillment+Shipping)<br> **In this case, once an order is placed, the seller will be responsible to manage shipment &amp; order fulfillment.</p><p>**Case 2: Send To Merchant<br> **This is the case when the admin adds his/her own warehouse address and manage the order fulfillment &amp; shipping label.</p><p>Once you choose this option, you will have the option to add a warehouse location.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/Screenshot-85-1-1200x619.png" alt="Screenshot-85-1"></p><p>Clicking on the button, the admin will add location.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/UPS-Configuration-Admin-1154x1024.png" alt="UPS-Configuration-Admin"></p><p>Now, as soon as an order is placed, the seller will have the option to send the parcel to the admin for fulfillment.<br> For this, the seller needs to visit the Order Listing section&gt;&gt;Select an Order&gt;&gt;Click View (Action). This will redirect the seller to the order detail page.</p><p>In the fulfillment detail section, the seller needs to click the &quot;<strong>Ship To Merchant&quot;</strong> button to send the parcel to the admin.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/Screenshot-86-1-1200x614.png" alt="Screenshot-86-1"></p><p>Choose UPS as a method of fulfillment.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/Screenshot-87-1-1200x620.png" alt="UPS shipping
"></p><p>Selecting the UPS shipping, the seller needs to choose a shipping method and click <strong>Agree &amp; fulfill</strong> button.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/12/Order-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-2-1-1200x821.png" alt="Order-Details-Seller-•-Multivendor-MarketPlace-2-1"></p><p>This way, the order gets fulfilled and the product quantity will get updated at the merchant&#39;s warehouse address.</p><h3 id="demo" tabindex="-1">Demo <a class="header-anchor" href="#demo" aria-label="Permalink to &quot;Demo&quot;">​</a></h3><p>Check the Demo of the Multi-vendor App: <a href="https://multivendor-marketplace-5.myshopify.com/pages/seller-profile" target="_blank" rel="noreferrer">https://multivendor-marketplace-5.myshopify.com/pages/seller-profile</a></p>`,96)])])}const u=t(r,[["render",a]]);export{d as __pageData,u as default};
